import React from "react";
import "./App.css";
import { jsx, ThemeProvider, Styled } from 'theme-ui'
import theme from './theme';

function App() {
  return (
    <ThemeProvider theme={theme}>

        <h1 className='App'>Theme UI + Create React App</h1>

    </ThemeProvider>
  )
}

export default App;
